import React from "react";
import "./Header.css";

const Header: React.FC = () => {
  return (
    <header className="header">
      <div className="logo">
        <img src="/logo.png" alt="Roque Labs Logo" />
      </div>
      <h1>roque LABS</h1>
    </header>
  );
};

export default Header;
